INSERT INTO `assessment_variable` (`assessment_variable_id`,`assessment_variable_type_id`,`display_name`,`description`,`measure_id`,`measure_answer_id`,`formula_template`,`date_created`) VALUES (71943,1,'','<p>Individuals who have experienced traumatic events - such as physical \nor sexual abuse, military combat, sudden loss of loved ones, serious \naccidents or disasters, etc. - vary considerably in their response to \nthese events. Some people do not have any misgivings about what they did\n during these events, whereas other people do. They may have misgivings \nabout something they did (or did not do), about beliefs or thoughts they\n had, or for having had certain feelings (or lack of feelings). The \npurpose of this questionnaire is to evaluate your response to a \ntraumatic experience. <br></p><p><br></p><p><u>Briefly describe what happened</u>:</p><p><br></p>Please take a few moments to think about what happened. All the items below refer to events related to this experience. <b>Select the option that best describes how you feel about each statement. Please choose ONE answer. </b>\n				',1062,NULL,NULL,'2015-04-06 13:07:41');
