INSERT INTO `assessment_variable` (`assessment_variable_id`,`assessment_variable_type_id`,`display_name`,`description`,`measure_id`,`measure_answer_id`,`formula_template`,`date_created`) VALUES (71948,1,'','<p>These items deal with the ways you\'ve been coping with any stress in your life. There are many ways to try and deal with problems. These items ask what you\'ve been doing to cope with current stressors in your life. Obviously, different people deal with things in different ways. but I\'m interested in how you\'ve tried to deal with it. Each item says something about a particular way of coping. I want to know to what extent you\'ve been doing what the item says. How much or how frequently? Don\'t answer on the basis of whether it seems to be working or not - just whether or not you\'re doing. Use these response choices. Try to rate each item separately in your mind form the others. Make your answers as true FOR YOU as you can. <b>Please choose ONE answer. </b><br></p>',1067,NULL,NULL,'2015-04-06 13:49:39');
