INSERT INTO `assessment_variable` (`assessment_variable_id`,`assessment_variable_type_id`,`display_name`,`description`,`measure_id`,`measure_answer_id`,`formula_template`,`date_created`) VALUES (71985,1,'','These items deal with the ways you\'ve been coping with any stress in \nyour life. There are many ways to try and deal with problems. These \nitems ask what you\'ve been doing to cope with current stressors in your \nlife. Obviously, different people deal with things in different ways. \nbut I\'m interested in how you\'ve tried to deal with it. Each item says \nsomething about a particular way of coping. I want to know to what \nextent you\'ve been doing what the item says. How much or how frequently?\n Don\'t answer on the basis of whether it seems to be working or not - \njust whether or not you\'re doing. Use these response choices. Try to \nrate each item separately in your mind form the others. Make your \nanswers as true FOR YOU as you can. <b>Please choose ONE answer. </b><p><br></p>',1076,NULL,NULL,'2015-04-06 13:54:17');
